import "./App.css";
import allCountryScores from "./score";

function App() {
  return (
    <div className="App">
      <h1>High Score Per Country</h1>
      <MakeList />
    </div>
  );
}

function PLayerScore() {
  return <div></div>;
}
function MakeList() {
  return (
    <div>
      <ul>
        {allCountryScores
          .sort((a, b) => a.name.localeCompare(b.name))
          .map((element) => (
            //  <h2>High Scores: {element.name}</h2>

            <li>{element.name}</li>
          ))}
      </ul>
    </div>
  );
}

export default App;
